(1, 'document', 'text/html', 'Главная', '', '', 'glavnaya', '', 1, 0, 0, 0, 0, '', '<p>Qmedia Market &mdash; магазин полезных вещей для себя, дома, офиса и дачи. Здесь вы найдете товары под свои предпочтения: от аудиотехники и одежды до строительных материалов и велосипедов. Работаем с проверенными производителями с 2007 года. Доставляем товары точно в срок.<br /><br />Покупка товара проста только на первый взгляд. Нужно думать о том, как оформить доставку, кто соберет шкаф или установит кондиционер. В нашем магазине эти услуги уже продуманы. Думайте только о подборе товаров в каталоге. Для этого предлагаем комплексный подход &mdash; наша команда выполнит все задачи!</p>', 1, 6, 0, 1, 1, 1, 1130304721, 1, 1737360865, 0, 0, 0, 1130304721, 1, 'Base Install', 0, 0, 0, 0, 0, 1),
