INSERT INTO `f743_site_htmlsnippets` (`id`, `name`, `description`, `editor_type`, `editor_name`, `category`, `cache_type`, `snippet`, `locked`, `createdon`, `editedon`, `disabled`) VALUES
(1, 'header1', 'sample header scripts', 2, 'none', 2, 0, '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=[(modx_charset)]\" /> \r\n<title>[*meta_title*]</title>\r\n[*meta_noindex*]\r\n<meta name=\"keywords\" content=\"[*meta_keywords*]\" />\r\n<meta name=\"description\" content=\"[*meta_description*]\" />\r\n<base href=\"[(site_url)]\"/>\r\n', 0, 0, 1736576972, 0),
(2, 'mm_rules', 'Default ManagerManager rules.', 0, 'none', 3, 0, '// more example rules are in assets/plugins/managermanager/example_mm_rules.inc.php\r\n// example of how PHP is allowed - check that a TV named documentTags exists before creating rule\r\n\r\nif ($modx->db->getValue($modx->db->select(\'count(id)\', $modx->getFullTableName(\'site_tmplvars\'), \"name=\'documentTags\'\"))) {\r\n	mm_widget_tags(\'documentTags\', \' \'); // Give blog tag editing capabilities to the \'documentTags (3)\' TV\r\n}\r\nmm_widget_showimagetvs(); // Always give a preview of Image TVs\r\n\r\nmm_createTab(\'SEO\', \'seo\', \'\', \'\', \'\', \'\');\r\nmm_moveFieldsToTab(\'meta_title,meta_keywords,meta_description,seo_override,meta_noindex,sitemap_changefreq,sitemap_priority,sitemap_exclude\', \'seo\', \'\', \'\');\r\nmm_widget_tags(\'meta_keywords\',\',\'); // Give blog tag editing capabilities to the \'documentTags (3)\' TV\r\n\r\n\r\n//mm_createTab(\'Images\', \'photos\', \'\', \'\', \'\', \'850\');\r\n//mm_moveFieldsToTab(\'images,photos\', \'photos\', \'\', \'\');\r\n\r\n//mm_hideFields(\'longtitle,description,link_attributes,menutitle,content\', \'\', \'6,7\');\r\n\r\n//mm_hideTemplates(\'0,5,8,9,11,12\', \'2,3\');\r\n\r\n//mm_hideTabs(\'settings, access\', \'2\');\r\n', 0, 0, 0, 0),
(3, 'header', 'шапка для всех страниц', 2, 'none', 8, 0, ' <!-- Шапка -->\r\n    <div class=\"container header\">\r\n            <div class=\"burger col\">\r\n                <span class=\"line-burger\"></span>\r\n                <span class=\"line-burger\"></span>\r\n                <span class=\"line-burger\"></span>\r\n            </div>\r\n            <div class=\"navigation row\">\r\n                <ul class=\"page-navigation row\">\r\n					[[DocLister?\r\n						&parents=`0`\r\n						&limit=`0`\r\n						&depth=`2`\r\n						&tpl=`@CODE: <a href=[+url+]><li>[+pagetitle+]</li></a>`\r\n						&addWhereList=`c.id IN ([(client_header_menu)])`\r\n						&sortBy=`FIELD(c.id, [(client_header_menu)])`\r\n						&sortDir=`ASC`\r\n					]]\r\n                </ul>\r\n				[!multiTV?\r\n					&tvName=header_phones \r\n					&fromJson=[(client_header_phones)]\r\n					&tvName=`client_header_phones`\r\n					&outerTpl=`@CODE:<div class=\"contacts row\">\r\n										((wrapper))\r\n									</div> `\r\n					&rowTpl=`list_numbers_header`\r\n				!]\r\n            </div>\r\n            <div class=\"main-function row\" >\r\n                <div class=\"row\">\r\n                    <img style=\"margin-right: 12px;\" src=\"/assets/images/logo.png\">\r\n                    <div >\r\n                        <p class=\"text-logo\">Qmedia Market</p>\r\n                        <p class=\"description-logo\">Интернет-магазин полезных вещей</p>\r\n                    </div>\r\n                </div>\r\n                <div class=\"input-wrapper\">\r\n                    <input class=\"input-wrapper input-place\" placeholder=\"Поиск по каталогу\">\r\n                    <img class=\"input-wrapper search-icon\" src=\"/assets/images/search.png\">\r\n                </div>\r\n                <img class=\"mobile-search\" src=\"/assets/images/search.png\">\r\n            </div>\r\n    </div>\r\n', 0, 1736577003, 1737312596, 0),
(4, 'footer', 'подвал для всех страниц', 2, 'none', 8, 0, '<!-- Подвал -->\r\n\r\n    <div style=\"width: 100%;background-color: #212529;margin-top: auto; color: #fff;\">\r\n        <div class=\"container footer-block\">\r\n            <div class=\"gap-element company-info\">\r\n                <img class=\"image-logo-footer\" src=\"/assets/images/logo-full-white.png\"></img>\r\n                <p class=\"text-info-company\" style=\"font-size: 10px;\">\r\n                    [(client_footer_company_info)]\r\n                </p>\r\n            </div>\r\n            <div class=\"info-footer\">\r\n                <div class=\"gap-element\">\r\n                    <p style=\"font-size: 14px ;font-weight: bold;\" >Каталог</p>\r\n                    <ul na class=\"wrap-text no-bullets\">\r\n						[[DocLister?\r\n							&parents=`5`\r\n						&tpl=`@CODE: <a style=\"color: #fff\" href=\"[+url+]\"><li class=\"text-info\">[+pagetitle+]</li></a>`\r\n							&sortBy=`menuindex`\r\n							&sortDir=`ASC`\r\n						]]\r\n                    </ul>\r\n                </div>\r\n                <div  class=\"gap-element\">\r\n                    <p style=\"font-size: 14px ;font-weight: bold;\">Информация</p>\r\n                    <ul class=\"no-bullets wrap-text\">\r\n						[[DocLister?\r\n							&parents=`0`\r\n							&limit=`0`\r\n							&depth=`2`\r\n							&tpl=`@CODE: <a style=\"color: #fff\" href=\"[+url+]\"><li class=\"text-info\">[+pagetitle+]</li></a>`\r\n							&addWhereList=`c.id IN ([(client_footer_info_menu)])`\r\n							&sortBy=`FIELD(c.id, [(client_footer_info_menu)])`\r\n							&sortDir=`ASC`\r\n						]]\r\n                    </ul>\r\n                </div>\r\n				\r\n			[*FirstChildRedirect? &docid=`[+id+]` &default=`1`*]\r\n                <div class=\"gap-element\">\r\n                    <p style=\"font-size: 14px ; font-weight: bold;\">Связаться с нами</p>\r\n                    <ul class=\"no-bullets\">\r\n						[!multiTV?\r\n							&tvName=footer_phones \r\n							&fromJson=[(client_footer_phones)]\r\n							&outerTpl=`@CODE: ((wrapper))`\r\n							&rowTpl=`@CODE: <li style=\"width: 100%;\" class=\"row\" title=[+description+]>\r\n												<img style=\"width: 14px; height:  14px; margin-right: 20px;\" src=\"/assets/images/phone.png\">\r\n												<a style=\"color: #fff\" class=\"text-info\" href=\"tel:[+phone_number+]\">[+phone_number+]</a>\r\n											</li>`\r\n						!]\r\n						[!multiTV?\r\n							&tvName=footer_emails \r\n							&fromJson=[(client_footer_emails)]\r\n							&outerTpl=`@CODE: ((wrapper))`\r\n							&rowTpl=`@CODE: <li style=\"width: 100%;\" class=\"row\" title=[+description+]>\r\n												<img style=\"width: 14px; height:  14px; margin-right: 20px;\" src=\"/assets/images/email.png\">\r\n												<a style=\"color: #fff\" class=\"text-info\" href=\"mailto:[+email+]\">[+email+]</a>\r\n											</li>`\r\n						!]\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>', 0, 1736577051, 1737365162, 0),
(5, 'head', 'мета теги', 2, 'none', 8, 0, '    <meta charset=\"UTF-8\">\r\n	<meta name=\"description\" content=[*meta_description*]>\r\n    <meta name=\"keywords\" content=[*meta_keywords*]>\r\n    <meta property=\"og:title\" content=[*og_title*]>\r\n    <meta property=\"og:description\" content=[*meta_description*]>\r\n    <meta property=\"og:type\" content=\"website\">\r\n	<meta property=\"og:url\" content=[(site_url)]>\r\n\r\n	<link\r\n        rel=\"stylesheet\"\r\n        href=\"https://cdn.jsdelivr.net/npm/swiper@11/swiper-bundle.min.css\"\r\n    />\r\n    <link href=\"https://fonts.googleapis.com/css2?family=Inter:ital,opsz,wght@0,14..32,100..900;1,14..32,100..900&family=Mulish:wght@200..1000&display=swap\" rel=\"stylesheet\">\r\n    \r\n	\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\r\n    <link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\r\n    <link href=\"https://fonts.googleapis.com/css2?family=Inter:ital,opsz,wght@0,14..32,100..900;1,14..32,100..900&family=Mulish:wght@200..1000&display=swap\" rel=\"stylesheet\">\r\n    <link rel=\"stylesheet\" href=\"/assets/templates/style.css\">\r\n    <title>[*meta_title*]</title>', 0, 1736577144, 1737106625, 0),
(11, 'home_banners', 'чанк банера', 2, 'none', 8, 0, '<picture class=\"swiper-slide\">\r\n	<source srcset=\"/[[phpthumb? &input=`[+image_mobile+]` &options=`w=900,f=webp`]]\" media=\"(max-width: 1199px)\">\r\n	<img src=\"/[[phpthumb? &input=`[+image_desktop+]` &options=`w=1600,f=webp`]]\"class=\"home_banner\">\r\n</picture>', 0, 1737124301, 1737126321, 0),
(6, 'product_card', 'Карточка товара', 2, 'none', 8, 0, '<li class=\"product-card col\">\r\n	<img src=\"/[[phpthumb? &input=`[*product_image@[+id+]*]` &options=`w=400,h=400,f=far,zc=1, bg=ffffff`]]\">\r\n	<div class=\"price\">[*product_price@[+id+]*]</div>\r\n	<div class=\"description\">[+pagetitle+]</div>\r\n</li>', 0, 1736634451, 1737360015, 0),
(7, 'category', 'категория', 2, 'none', 8, 0, '<a href=\"[+url+]\" class=\"category col\">\r\n	<img src=\"[[phpthumb? &input=`[*category_image@[+id+]*]` &options=`w=200,h=200,f=webp,zc=1`]]\" class=\"category_image\">\r\n	<p class=\"small-title\">[+pagetitle+]</p>\r\n</a>', 0, 1736634609, 1737271151, 0),
(8, 'swiperSlides', '', 2, 'none', 0, 0, '<div class=\"swiper-slide\">\r\n    <picture>\r\n        <source srcset=\"[+image_mobile+]\" media=\"(max-width: 768px)\">\r\n        <img class=\"home_banner\" src=\"[+image_desktop+]\" alt=\"\">\r\n    </picture>\r\n</div>', 0, 1736712159, 1736712159, 0),
(9, 'pagetitle', 'Хлебные крошки', 2, 'none', 8, 0, '<!-- Хлебные крошки -->\r\n<style>\r\n    .breadcrumb li {\r\n        display: flex;\r\n    	flex-direction: row;\r\n    }\r\n	\r\n	.breadcrumb {\r\n        display: flex;\r\n    	flex-direction: row;\r\n    }\r\n	\r\n	.crumb-item{\r\n		gap: 10px\r\n	}\r\n</style>\r\n\r\n\r\n<div class=\"container col\" style=\"gap: 10px; margin-bottom: 10px;\">\r\n    <nav class=\"crumbs\">\r\n        <ul class=\"row\" style=\"display: flex; align-items: center; gap: 10px; list-style: none; padding: 0; margin: 0; width: 100%; height: 18px\">\r\n            [[DLCrumbs?\r\n                &showHome=`1`\r\n                &showCurrent=`1`\r\n                &tpl=`@CODE:<li class=\"crumb-item\" >\r\n                        <a href=\"[+url+]\">[+pagetitle+]</a>\r\n                        <img style=\"width: 16px; height: 16px;\" src=\"/assets/images/chevron-right.png\">\r\n                    </li>`\r\n                &tplCurrent=`@CODE:<span class=\"crumb-item\">[+pagetitle+]</span>`\r\n            ]]\r\n        </ul>\r\n    </nav>\r\n</div>\r\n', 0, 1736932121, 1737362766, 0),
(10, 'menu-item', '', 2, 'none', 8, 0, '', 0, 1736944898, 1736944898, 0),
(14, 'form_chunk', '', 2, 'none', 8, 0, '<form class=\"form col\" method=\"post\">\r\n	<input type=\"hidden\" name=\"formid\" value=\"basic\">\r\n	<div>\r\n		<p class=\"form-text\">Имя *</p>\r\n		<input id=\"name\" name=\"name\" class=\"input-place-form\" placeholder=\"Екатерина\" value=\"[+name.value+]\">\r\n		[+name.error+]\r\n	</div>\r\n	<div>\r\n		<p class=\"form-text\">Телефон</p>\r\n		<input id=\"number\" name=\"number\" class=\"input-place-form\" placeholder=\"+375 ___ ___-__-__\" value=\"[+number.value+]\">\r\n		[+number.error+]\r\n	</div>\r\n	<div>\r\n		<p class=\"form-text\">Email *</p>\r\n		<input id=\"email\" name=\"email\" class=\"input-place-form\" placeholder=\"katya@mail.by\" value=\"[+email.value+]\">\r\n		[+email.error+]\r\n	</div>\r\n	<span style=\"font-size: 14px; color: #d63d3d; text-align: center;  \">[+form.messages+]</span>\r\n	<button type=\"submit\" class=\"btn-send\">Отправить</button>\r\n</form>', 0, 1737330019, 1737330173, 0),
(13, 'list_numbers_header', '', 2, 'none', 0, 0, '<div class=\"row\" title=[+description+]>\r\n	<img style=\"width: 20px; height: 20px; margin-right: 20px;\" src=\"/assets/images/Vector.png\">\r\n	<a href=\"tel:[+phone_number+]\">[+phone_number+]</a>\r\n</div>', 0, 1737274166, 1737312546, 0);
INSERT INTO `f743_site_modules` (`id`, `name`, `description`, `editor_type`, `disabled`, `category`, `wrap`, `locked`, `icon`, `enable_resource`, `resourcefile`, `createdon`, `editedon`, `guid`, `enable_sharedparams`, `properties`, `modulecode`) VALUES
(1, 'Doc Manager', '<strong>1.1.1</strong> Quickly perform bulk updates to the Documents in your site including templates, publishing details, and permissions', 0, 0, 4, 0, 0, '', 0, '', 0, 0, 'docman435243542tf542t5t', 1, '[]', ' \n/**\n * Doc Manager\n * \n * Quickly perform bulk updates to the Documents in your site including templates, publishing details, and permissions\n * \n * @category	module\n * @version 	1.1.1\n * @license 	http://www.gnu.org/copyleft/gpl.html GNU Public License (GPL)\n * @internal	@properties\n * @internal	@guid docman435243542tf542t5t	\n * @internal	@shareparams 1\n * @internal	@dependencies requires files located at /assets/modules/docmanager/\n * @internal	@modx_category Manager and Admin\n * @internal    @installset base, sample\n * @lastupdate  09/04/2016\n */\n\ninclude_once(MODX_BASE_PATH.\'assets/modules/docmanager/classes/docmanager.class.php\');\ninclude_once(MODX_BASE_PATH.\'assets/modules/docmanager/classes/dm_frontend.class.php\');\ninclude_once(MODX_BASE_PATH.\'assets/modules/docmanager/classes/dm_backend.class.php\');\n\n$dm = new DocManager($modx);\n$dmf = new DocManagerFrontend($dm, $modx);\n$dmb = new DocManagerBackend($dm, $modx);\n\n$dm->ph = $dm->getLang();\n$dm->ph[\'theme\'] = $dm->getTheme();\n$dm->ph[\'ajax.endpoint\'] = MODX_SITE_URL.\'assets/modules/docmanager/tv.ajax.php\';\n$dm->ph[\'datepicker.offset\'] = $modx->config[\'datepicker_offset\'];\n$dm->ph[\'datetime.format\'] = $modx->config[\'datetime_format\'];\n\nif (isset($_POST[\'tabAction\'])) {\n    $dmb->handlePostback();\n} else {\n    $dmf->getViews();\n    echo $dm->parseTemplate(\'main.tpl\', $dm->ph);\n}'),
(2, 'Extras', '<strong>0.1.4</strong> first repository for Evolution CMS', 0, 0, 4, 0, 0, '', 0, '', 0, 0, 'store435243542tf542t5t', 1, '[]', ' \r\n/**\r\n * Extras\r\n * \r\n * first repository for Evolution CMS\r\n * \r\n * @category	module\r\n * @version 	0.1.4\r\n * @internal	@properties\r\n * @internal	@guid store435243542tf542t5t	\r\n * @internal	@shareparams 1\r\n * @internal	@dependencies requires files located at /assets/modules/store/\r\n * @internal	@modx_category Manager and Admin\r\n * @internal    @installset base, sample\r\n * @lastupdate  25/11/2016\r\n */\r\n\r\n//AUTHORS: Bumkaka & Dmi3yy \r\ninclude_once(\'../assets/modules/store/core.php\');'),
(3, 'ClientSettings', '<strong>2.2.1</strong> Customizable set of fields for user settings', 0, 0, 4, 0, 0, '', 0, '', 0, 0, 'clsee234523g354f542t5t', 1, '{\"prefix\":[{\"label\":\"Prefix for settings\",\"type\":\"text\",\"value\":\"client_\",\"default\":\"client_\",\"desc\":\"\"}],\"config_path\":[{\"label\":\"Path to configuration files\",\"type\":\"text\",\"value\":\"\",\"default\":\"\",\"desc\":\"\"}]}', '\n\nrequire_once MODX_BASE_PATH . \'assets/modules/clientsettings/core/src/ClientSettings.php\';\n\nif (!$modx->hasPermission(\'exec_module\')) {\n    $modx->sendRedirect(\'index.php?a=106\');\n}\n\nif (!is_array($modx->event->params)) {\n    $modx->event->params = [];\n}\n\nif (!function_exists(\'renderFormElement\')) {\n    include_once MODX_MANAGER_PATH . \'includes/tmplvars.commands.inc.php\';\n    include_once MODX_MANAGER_PATH . \'includes/tmplvars.inc.php\';\n}\n\nif (isset($_REQUEST[\'stay\'])) {\n    $_SESSION[\'stay\'] = $_REQUEST[\'stay\'];\n} else if (isset($_SESSION[\'stay\'])) {\n    $_REQUEST[\'stay\'] = $_SESSION[\'stay\'];\n}\n\n(new ClientSettings($params))->processRequest();\n');
