INSERT INTO `f743_site_templates` (`id`, `templatename`, `templatealias`, `description`, `editor_type`, `category`, `icon`, `template_type`, `content`, `locked`, `selectable`, `createdon`, `editedon`) VALUES
(4, 'Тестовый шаблон', NULL, '', 0, 7, '', 0, '<h1>test<h1>', 0, 1, 1736548577, 1736941186),
(6, 'Главная страница', NULL, '', 0, 7, '', 0, '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n	<head>\r\n		{{head}}\r\n		<style>\r\n			.home_banner {\r\n			background-image: url(\'[*home_banner_desktop*]\');\r\n		}\r\n		\r\n		@media (max-width: 1199px) {\r\n			.home_banner {\r\n			background-image: url(\'[*home_banner_mobile*]\');\r\n		}\r\n		}		\r\n		</style>	\r\n	</head>\r\n<body>\r\n    {{header}}\r\n    <!-- Основной блок -->\r\n	\r\n    <div id=\"container\" class=\" col main\">\r\n		[!multiTV?\r\n			&tvName=`home_banners`\r\n			&outerTpl=`@CODE:<div class=\"swiper-container\" style=\"overflow: visible; overflow: hidden;\">\r\n								<div class=\"swiper-wrapper\">\r\n									((wrapper))\r\n								</div>\r\n							</div>  `\r\n			&rowTpl=`home_banners`\r\n		!]\r\n        <script src=\"https://unpkg.com/swiper@9.0.0/swiper-bundle.min.js\"></script>\r\n        <script src=\"/assets/templates/script.js\"></script>   \r\n        <div style=\"display: flex; justify-content: center; gap: 10px; overflow: hidden; \" class=\"container row\">\r\n			[[DocLister?\r\n				&parents=`5`\r\n				&limit=`0`\r\n				&tpl=`category`\r\n				&sortBy=`menuindex`\r\n				&sortDir=`ASC`\r\n			]]\r\n        </div>\r\n		\r\n        <div class=\"container feedback\">\r\n            <div class=\"seo-content\">\r\n                <h1  style=\"font-size: 20px;\">[*meta_h1*]</h1>\r\n                <p>[*content*]</p>\r\n            </div>\r\n			\r\n			[!FormLister\r\n				&formid=`basic`\r\n				&rules=`{\r\n					\"name\": {\r\n						\"required\": \"Обязательно введите имя\"\r\n					},\r\n					\"email\": {\r\n						\"required\": \"Обязательно введите email\",\r\n						\"email\": \"Введите корректный email\"\r\n					}\r\n				}`\r\n			   &formTpl=`form_chunk`\r\n						&ccSender=`1`\r\n						&ccSenderField=`email`\r\n						&errorTpl=`@CODE:<span class=\"error-msg\">[+message+]</span>`\r\n						&from=`[(client_form_from)]`\r\n						&to=`[(client_form_to)]`\r\n						&subject=`Новое сообщение`\r\n						&ccSenderTpl=`@CODE:<div  class=\"success-msg\">Спасибо за ваше сообщение, <u>[+name.value+]</u>. Мы свяжемся с вами в ближайшее время!</div>`\r\n						&successTpl=`@CODE:<div  class=\"success-msg\">Спасибо за ваше сообщение, <u>[+name.value+]</u>. Мы свяжемся с вами в ближайшее время!</div>`\r\n						&reportTpl=`@CODE: <div>\r\n							<p>Посетитель сайта <u><b>[(site_name)]</b></u> оставил заявку.</p>\r\n							<p>Имя: <u>[+name.value+]</u>.</p>\r\n							<p>Email: <u>[+email.value+]</u></p>\r\n							<p>Телефон: <u>[+number.value+]</u></p>\r\n						</div>`\r\n			!]\r\n        </div>		\r\n    </div>\r\n    {{footer}}\r\n</body>\r\n</html>', 0, 1, 1736576506, 1737364047),
(9, 'Карточка товара', NULL, 'карточка товара', 0, 7, '', 0, 'Карточка товара\r\n\r\n<img src=\'/[*product_image*]\'>\r\n{{pagetitle}}', 0, 1, 1736627470, 1736941183),
(7, 'Категория каталога', NULL, 'Каталог магазина', 0, 7, '', 0, '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n	{{head}}\r\n</head>\r\n<body>\r\n	{{header}}\r\n\r\n    <!-- Хлебные крошшки -->\r\n    {{pagetitle}}\r\n\r\n    <!-- Основные функции -->\r\n    <div class=\"container row\" style=\"gap: 40px; margin-bottom: 10px; \">\r\n        <div class=\"aside col\">\r\n            <div class=\"aside-inner category row\">\r\n                <img style=\"width: 20px; height: 20px;\" src=\"/assets/images/chevron-left.png\">\r\n                <p ><a href=\"/category\">Каталог</a></p>\r\n            </div>	\r\n            <nav>\r\n				[[DLMenu?\r\n					&parents=`[*parent*]`\r\n					&maxDepth=`1`\r\n					&tpl=`@CODE:<li class=\"aside-inner\"><a href=\"[+url+]\">[+pagetitle+]</a></li>`\r\n					&activeClass=`@CODE:<li class=\"aside-inner\"><a href=\"[+url+]\">[+pagetitle+]</a>2</li>`\r\n					&sortBy=`menuindex`\r\n					&sortDir=`ASC`\r\n				]]		\r\n            </nav>\r\n        </div>\r\n        <div class=\"main-block col\">\r\n            <div class=\"products col\" >\r\n                <ul class=\"products-list row\">\r\n					[[DocLister?\r\n						&parents=`[*id*]`\r\n						&display=`5`\r\n						&tpl=`product_card`\r\n						&sortBy=`menuindex`\r\n						&sortDir=`ASC`\r\n						&paginate=`pages`\r\n						&PrevNextAlwaysShow=`0`\r\n						&TplNextP=`@CODE: `\r\n						&TplPrevP=`@CODE: `\r\n						&paginateAlwaysShowLinks=`1`\r\n					]]\r\n                </ul>\r\n				[+pages+]\r\n            </div>\r\n            <div class=\"seo col\">\r\n                <h4>[*meta_h1*]</h4>\r\n                <p style=\"font-size: 14px;\">[*content*]</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    {{footer}}\r\n</body>\r\n</html>', 0, 1, 1736577501, 1737360701),
(8, 'Информационная страница', NULL, 'Информация', 0, 7, '', 0, '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n	<head>\r\n		{{head}}\r\n	</head>\r\n<body>\r\n    {{header}}\r\n    <!-- Хлебные крошшки -->\r\n	{{pagetitle}}\r\n\r\n    <div class=\"container\" style=\"margin-top: 20px; margin-bottom: 50px; justify-content: flex-start;\">\r\n        [*content*]\r\n    </div>\r\n	\r\n	\r\n	{{footer}}\r\n</body>\r\n</html>', 0, 1, 1736577701, 1737342591);
